import{_ as a,c as t,o as r,ag as o}from"./chunks/framework.By2cXeI6.js";const m=JSON.parse('{"title":"系列 2 —— 精选文章链接","description":"","frontmatter":{},"headers":[],"relativePath":"pages/lotsOfDifferent/demo2_articles/index.md","filePath":"pages/lotsOfDifferent/demo2_articles/index.md"}'),i={name:"pages/lotsOfDifferent/demo2_articles/index.md"};function n(s,e,c,d,l,h){return r(),t("div",null,[...e[0]||(e[0]=[o('<h1 id="系列-2-——-精选文章链接" tabindex="-1">系列 2 —— 精选文章链接 <a class="header-anchor" href="#系列-2-——-精选文章链接" aria-label="Permalink to &quot;系列 2 —— 精选文章链接&quot;">​</a></h1><h2 id="_1-vue3-的宏到底是什么东西" tabindex="-1">1. <a href="https://mp.weixin.qq.com/s/b-7hd9ejMR1OIjlvYNbIjQ" target="_blank" rel="noreferrer">vue3 的宏到底是什么东西？</a> <a class="header-anchor" href="#_1-vue3-的宏到底是什么东西" aria-label="Permalink to &quot;1. [vue3 的宏到底是什么东西？](https://mp.weixin.qq.com/s/b-7hd9ejMR1OIjlvYNbIjQ)&quot;">​</a></h2><h3 id="_1-1-宏的定义" tabindex="-1">1.1 宏的定义 <a class="header-anchor" href="#_1-1-宏的定义" aria-label="Permalink to &quot;1.1 宏的定义&quot;">​</a></h3><p><code>vue3</code>的宏是一种特殊的代码，在编译时会将这些特殊的代码转换为浏览器能够直接运行的指定代码，根据宏的功能不同，转换后的代码也不同。</p><h3 id="_1-2-宏在那个阶段运行" tabindex="-1">1.2 宏在那个阶段运行 <a class="header-anchor" href="#_1-2-宏在那个阶段运行" aria-label="Permalink to &quot;1.2 宏在那个阶段运行&quot;">​</a></h3><p><strong>宏在编译阶段运行：</strong> 例如在编译时 <code>defineProps</code> 宏就会被转换为定义 <code>props</code> 相关的代码，当在浏览器运行时自然也就没有了 <code>defineProps</code> 宏相关的代码了。所以才说宏是在编译时执行的代码，而不是运行时执行的代码。</p><h3 id="_1-3-为什么这些宏不需要手动从-vue-中-import" tabindex="-1">1.3 为什么这些宏不需要手动从 vue 中 import？ <a class="header-anchor" href="#_1-3-为什么这些宏不需要手动从-vue-中-import" aria-label="Permalink to &quot;1.3 为什么这些宏不需要手动从 vue 中 import？&quot;">​</a></h3><p>因为在编译时已经将这些宏替换为指定的浏览器能够直接运行的代码，在运行时已经不存在这些宏相关的代码，自然不需要从 vue 中 import。</p><h3 id="_1-4-为什么只能在-setup-顶层中使用这些宏" tabindex="-1">1.4 为什么只能在 setup 顶层中使用这些宏？ <a class="header-anchor" href="#_1-4-为什么只能在-setup-顶层中使用这些宏" aria-label="Permalink to &quot;1.4 为什么只能在 setup 顶层中使用这些宏？&quot;">​</a></h3><p>因为在编译时只会去处理<code>setup</code>顶层的宏，其他地方的宏会原封不动的输出回来。在运行时由于我们没有在任何地方定义这些宏，当代码执行到宏的时候当然就会报错。</p><h2 id="_2-阮一峰-ecmascript-6-入门" tabindex="-1">2. <a href="https://es6.ruanyifeng.com/#docs/intro" target="_blank" rel="noreferrer">阮一峰----ECMAScript 6 入门</a> <a class="header-anchor" href="#_2-阮一峰-ecmascript-6-入门" aria-label="Permalink to &quot;2. [阮一峰----ECMAScript 6 入门](https://es6.ruanyifeng.com/#docs/intro)&quot;">​</a></h2><h2 id="_3-一张图读懂-commonjs-模块加载过程" tabindex="-1">3. <a href="https://juejin.cn/post/7366793018416955411" target="_blank" rel="noreferrer">一张图读懂 CommonJS 模块加载过程</a> <a class="header-anchor" href="#_3-一张图读懂-commonjs-模块加载过程" aria-label="Permalink to &quot;3. [一张图读懂 CommonJS 模块加载过程](https://juejin.cn/post/7366793018416955411)&quot;">​</a></h2>',12)])])}const _=a(i,[["render",n]]);export{m as __pageData,_ as default};
